import React from 'react';

function LoginPage() {
  return (
    // <div>
    //   LoginPage
    // </div>
    <div className='App'>
      <h1>Please login below to see your budget details</h1>
      <br/>
      <label>
        <h2>Username:</h2>
        <i class='fa fa-user icon'/>
        <input className='login-input' size={30} style={{'line-height': 15.0, 'font-size': 15.0}}  type='text' placeholder='Enter your username here...' autoFocus required/>
      </label>
      <br/>
      <br/>
      <label>
        <h2>Password:</h2>
        <input className='login-input' size={30} style={{'line-height': 15.0, 'font-size': 15.0}} type='password' placeholder='Enter your password here...' required/>
      </label>
      <br/>
      <br/>
      <br/>
      <button type='submit'>Login</button>
    </div>
  );
}

export default LoginPage;
